import React from 'react'

export const TrackSearchResult = ({ tracks }) => {
  return (
    tracks.map(track =>{
      <div className="d-flex m-2 align-items-center">
       <img src={track.album.url} style={{ height: "64px", width: "64px" }} />
      </div>
    })
  )
}

export default TrackSearchResult;
